import React from 'react';

import Header from './components/Header';
import Categories from './components/Categories';
import Sort from './components/Sort';
import PizzaBlock from './components/PizzaBlock';

import './scss/app.scss';


function App() {
  return (
    <div class="wrapper">
      <Header />
      <div class="content">
        <div class="container">
          <div class="content__top">
            <Categories />
            <Sort/>
          </div>
          <h2 class="content__title">Все пиццы</h2>
          <div class="content__items">
            <PizzaBlock title="Мексиканская" price="500"/>
            <PizzaBlock title="Азербайджанская" price="300"/> 
            <PizzaBlock title="Азербайджанская" price="350" /> 
            <PizzaBlock title="Азербайджанская" price="400" /> 
            <PizzaBlock title="Азербайджанская" price="450" /> 
            <PizzaBlock title="Азербайджанская" price="560" /> 
            <PizzaBlock title="Азербайджанская" price="570" />
            <PizzaBlock title="Азербайджанская" price="580" />
            <PizzaBlock title="Азербайджанская" price="250" />
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
